PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE "spree_variants" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "sku" varchar(255) DEFAULT '' NOT NULL, "price" decimal(8,2) NOT NULL, "weight" decimal(8,2), "height" decimal(8,2), "width" decimal(8,2), "depth" decimal(8,2), "deleted_at" datetime, "is_master" boolean DEFAULT 'f', "product_id" integer, "count_on_hand" integer DEFAULT 0 NOT NULL, "cost_price" decimal(8,2) DEFAULT NULL, "position" integer);
CREATE INDEX "index_variants_on_product_id" ON "spree_variants" ("product_id");
COMMIT;
